data.selfPitch:
Diplômé d'HEC, j'ai rejoint après mes études une startup où j'ai pu contribuer à la construction de l'équipe commerciale et à la croissance rapide des ventes. Aujourd'hui, je pense avoir fait le tour des challenges qui m'étaient proposés. Je souhaite rejoindre une société ambitieuse, qui se donne les moyens d'atteindre ses objectifs.

J'ai acquis une expertise en vente de solutions SaaS. Mes interlocuteurs principaux sont les PDG, DRH, DAF et DSI. Les prospects sont variables : startup et scale-up, PME, groupes internationaux. Ci dessous, quelques exemples de mes actions ces deux dernières années :

- Plus d' 1M€ de vente individuelle (dont environ 40% de recurring) ;
- Recrutement et management de 5 business developers juniors ;
- Création d'un pôle outbound : recrutement, mise en place de la méthode de prospection et d'un outil de sales automation ;
- Gestion des prospects internationaux.

Je suis prêt à recruter et former une équipe compétitive pour porter un projet auquel je crois.
